import { toHaveAccessibleDescription } from "@testing-library/jest-dom/dist/matchers";
import PropTypes from "prop-types";

const Header = ({ title }) => {
  return (
    <header>
      <h1>{title}</h1>
    </header>
  );
};

Header.defaultProps = {
  title: 5,
};

Header.prototype = {
  title: PropTypes.string,
};

export default Header;
